DROP FUNCTION IF EXISTS lapsed.update_vn_in_cards();

CREATE FUNCTION lapsed.update_vn_in_cards()
    RETURNS INTEGER
    LANGUAGE plpgsql
AS
$$
DECLARE
    v_vn      RECORD;
    l_count   INTEGER = 0;
    l_rekv_id INTEGER;
    l_kokku   INTEGER = 0;
    l_vn      TEXT;
    l_ik      TEXT;
    l_id      INTEGER;
    v_kaart   RECORD;
BEGIN
    FOR v_vn IN
        SELECT vn,
               ik,
               asutus,
               yksus
        FROM tmp_viitenr
        WHERE vn IS NOT NULL
        LOOP
            l_rekv_id = (SELECT id FROM ou.rekv WHERE left(nimetus, 7) = left(v_vn.asutus, 7) LIMIT 1);
            l_vn = replace(v_vn.vn, E'\n', '');
            l_ik = v_vn.ik;

            IF l_rekv_id IS NULL
            THEN
                RAISE EXCEPTION 'Puudub l_rekv_id %', l_rekv_id;
            END IF;

/*
 В файле даны данные, которые надо внести в услуги взамен ранее неправильно внесенных или отсутствующих.
Но надо иметь ввиду, что прочие данные , которые не попали в файл, но закреплены за услугами в программе, трогать/менять/удалять НЕЛЬЗЯ
 */
            FOR v_kaart IN
                SELECT lk.properties ->> 'viitenr' AS viitenr,
                       lk.*
                FROM lapsed.lapse_kaart lk
                         INNER JOIN lapsed.laps l ON l.id = lk.parentid
                WHERE l.isikukood = v_vn.ik
                  AND lk.rekvid = l_rekv_id
                  AND lk.properties ->> 'yksus' = v_vn.yksus
--                  AND l.isikukood = '37807142212'
                  AND lk.staatus < 3
                LOOP

                    IF coalesce(v_kaart.viitenr, '') <> v_vn.vn
                    THEN
                        RAISE NOTICE 'uuendan  l_rekv_id %, l_ik %,v_kaart.viitenr %, v_vn.yksus %', l_rekv_id, l_ik, v_kaart.viitenr, v_vn.yksus;
                        UPDATE lapsed.lapse_kaart
                        SET properties = properties::JSONB || jsonb_build_object('viitenr', v_vn.vn)
                        WHERE id = v_kaart.id;

                        l_kokku = l_kokku + 1;
                    END IF;

                END LOOP;


        END LOOP;
    RETURN l_kokku;

END;
$$;

SELECT lapsed.update_vn_in_cards();

DROP FUNCTION IF EXISTS lapsed.update_vn_in_cards();

